// SearchBar.js
import React from 'react';

const SearchBar = ({ handleSearch }) => {
  return (
    <div className="search-bar">
      <input
        type="text"
        placeholder="Search by college name"
        onChange={handleSearch}
        className="search-input"
      />
    </div>
  );
};

export default SearchBar;
